import React from "react";
import yped from "typed.js";
export default function TypedSen() {
  React.useEffect(() => {
    const typed = new Typed(el.current, {
      strings: ["<i>First</i> sentence.", "&amp; a second sentence."],
      typeSpeed: 50,
    });
    return () => {
      typed.destroy();
    };
  }, []);

  return (
    <div className="App">
      <span ref={el} />
    </div>
  );
}
